import React from 'react'
import PropTypes from "prop-types"

const Button = ({color, text, onClick}) => {

  // const onClick = (e) => {
  //   console.log('clicked')
  // }
  return (
   <button onClick={onClick} style={{backgroundColor:color}} className="btn">{text}
   </button>
  )
}
